import styled from "styled-components";
import {Header} from "antd/lib/layout/layout";
import {Typography} from "antd";
import {Content} from "antd/es/layout/layout";

export const ContentComponentStyled = styled(Content)`
  //background-color: #A7EBDC;
  height: 78vh;
  display: flex;
  justify-content: space-between;
  background: linear-gradient(to right, rgb(58,170,218), transparent), url("https://i.ya-webdesign.com/images/background-lines-png-2.png");
  background-color: rgb(203,54,131);
  background-repeat: repeat-x;
  
  
`
